import styled from 'styled-components';
import ArrowRightFillIcon from 'remixicon-react/ArrowLeftFillIcon';

interface ContentsProps {
  openState: {
    open: boolean;
    onClick: () => void;
  };
}

function Contents({ openState }: ContentsProps) {
  return (
    <ContentsDiv isOpen={openState.open}>
      <ArrowLeftFillIcon />
      <OpenButton onClick={openState.onClick} />
    </ContentsDiv>
  );
}

export default Contents;

const ContentsDiv = styled.div<{ isOpen: boolean }>`
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  align-items: center;
  background-color: white;
  border: solid red 1px;
  height: 100vh;
  width: ${(props) => (props.isOpen ? '84.5vw' : '100vw')};
`;

const OpenButton = styled.button`
  background-color: red;
  height: 50px;
  width: 50px;
`;
